import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './Navbar';
import Collections from './Collections';

function App() {

  return(
    <BrowserRouter>
      <div>
        <Navbar />
        <Collections />

        <Routes>
          <Route></Route>
        </Routes>
      </div>
    </BrowserRouter>
  )
}

export default App;
